function encrypt(file) {
  var EncryptionKey = crypto.getRandomValues(new Uint8Array(16));
  var iv = crypto.getRandomValues(new Uint8Array(12));
  var tagLength = 16; 
  var algorithm = { name: 'AES-GCM', iv: iv };
  var EncryptedFile = await crypto.subtle.encrypt(algorithm, EncryptionKey, file);
}

async function decrypt(EncryptedFile, EncryptionKey, iv) {
  var algorithm = { name: 'AES-GCM', iv: iv };
  var DecryptedFile = await crypto.subtle.decrypt(algorithm, EncryptionKey, EncryptedFile);
  return DecryptedFile;
}

